import React from "react";
import {
  BrowserRouter as Router,
  Switch,
  Route
} from "react-dom";
import {Login} from "./componets/Login";


function App() {
  return (

      <Router>
        <Switch>
          <Route path="/login">
            <Login/>
          </Route>
        </Switch>
      </Router>

  );
}

export default App;
